import React, {Fragment, ReactFragment} from 'react';

export default function Header(){
	const [state, setState] = React.useState({});


	return(
		<>
			<header className={'Header'}>
				<div className={'mainLineHeader'}>
					<div id={'logo'}>123</div>
					<nav id={'menu'}>
						<div id={'linksContainer'}>
							<a className={'menuItem'} href="">GitHub</a>
							<a className={'menuItem'} href="">LeetCode</a>
							<a className={'menuItem'} href="">HH</a>
						</div>
						<a className={'menuItem switcher'} href=""> switcher</a>
					</nav>
				</div>
			</header>
		</>
	);

}
